function bindEditService(){var o=$(".form-table").on("click",".fa-times",function(){1<o.find("tbody tr").length&&$(this).closest("tr").remove()}).on("click",".fa-plus",function(t){t.stopPropagation();var n=o.find("tbody");n.append(n.find("tr:last").clone())})}function bindOrder(){$("*[data-action=comment]").click(function(t){t.preventDefault();var n=prompt("请输入您对本次服务的评分(1-10)","10");postJson($(this).attr("href"),{rank:n})})}